import React from 'react'

export default function Product(props) {
  return (
    <div className='product-container'>
        <img src="" alt="" />

        <p className='product-name'>Greyhound Hoodie {props.logo}</p>
        <p className='product-price'>$253.5</p>
    </div>
  )
}
